import { Fragment } from 'react';
import './App.css';
import Nav from './Components/Nav';
import Body from './Components/Body';
import Support from './Components/Support';
import Item4 from './Item/Item4';
import Blog from './Components/Blog';
import Line from './Line/Line';
import Pre_footer from './Components/Pre_footer';
import Footer from './Components/Footer';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';
/*import Item1 from "../Item/Item1";
import Item2 from "../Item/Item2";
import Item3 from "../Item/Item3";
*/
function App() {
  return (
   <Fragment>
    <Router>
    <Routes>

    <Route exact path='/' element={< Body/>}></Route>
    <Route exact path='/' element={< Support/>}></Route>
    <Route exact path='/' element={< Item4/>}></Route>
    <Route exact path='/' element={< Blog/>}></Route>
    <Route exact path='/' element={< Line/>}></Route>
    <Route exact path='/' element={< Pre_footer/>}></Route>
    <Route exact path='/' element={< Footer/>}></Route>
     </Routes>
     </Router>
   </Fragment>

  );
}

export default App;
